import React from 'react'
import { Container } from 'react-bootstrap'
import styled from 'styled-components'
import anil from './assets/images/anil.jpg'


const Team = () => {
    const Teamsection=styled.section`
            height:100%;
            background:${({theme})=>theme.colors.text2};
            background-size:50%;
            padding-top:100px;
            .parent{
                height: calc(100vh - 100px);
                h1{
                    color: white;
                    font-size: 2rem;
                    font-weight: 200;
                }
            }
    
    `;
  return (
    <Teamsection>
        <Container>
            <div className='parent'>
                <h1>our main team </h1>
                <div className='teamcontainer'>
                    <div className='box'>
                        
                    </div>
                </div>
            </div>
        </Container>
    </Teamsection>
  )
}

export default Team
